import React from "react";

const MainProfile = () => {
  return (
    <>
      <div className="container">
        <img
          src="https://www.timeshighereducation.com/sites/default/files/institution/header_image/200625_rush_asu_times_higher_education_profile_hero_image_-_biodesign_hero_shot_panorama1_final_0.jpg"
          alt=""
        />
      </div>
    </>
  );
};

export default MainProfile;
